import React from 'react';

const Footer = () => {
  return (
    <footer style={{ padding: '20px', backgroundColor: '#007bff', color: '#ffffff', borderTop: '1px solid #ddd', textAlign: 'center' }}>
      <p>&copy; 2024 The Event Solution. All rights reserved.</p>
      <p><a href="#" style={{ color: '#ffffff' }}>Privacy Policy</a> | <a href="#" style={{ color: '#ffffff' }}>Terms of Service</a></p>
    </footer>
  );
};

export default Footer;
